import React, { useState } from 'react';
import './contact.css';
import { useNavigate } from 'react-router-dom';

function Contact() {
  const [nom, setNom] = useState('');
  const [email, setEmail] = useState('');
  const [theme, setTheme] = useState('');
  const [tele, setTele] = useState(''); // Added state for telephone
  const [star, setStar] = useState('');
  const navigate = useNavigate();

  const IsValidate = () => {
    let isProceed = true;
    let errorMessage = 'Please enter a value for:';
    if (nom.trim() === '') {
      isProceed = false;
      errorMessage += ' Nom & Prenom';
    }
    if (tele.trim() === '') { // Changed 'tele' from 'null' check to 'trim() === '''
      isProceed = false;
      errorMessage += ' Telephone'; // Corrected typo in error message
    }
    if (email.trim() === '') {
      isProceed = false;
      errorMessage += ' Email';
    } else if (!/^[^\s@]+@[^\s@]+\.[^\s@]+$/.test(email)) {
      isProceed = false;
      errorMessage += ' Valid Email';
    }
    if (!isProceed) {
      alert(errorMessage);
    }
    return isProceed;
  };

  const sendEmail = (e) => {
    e.preventDefault();
    const formInfo = {
      nom,
      tele, // Added tele to formInfo
      email,
      theme,
      star,
    };
    if (IsValidate()) {
      fetch('http://localhost:3000/contact', {
        method: 'POST',
        headers: { 'content-type': 'application/json' },
        body: JSON.stringify(formInfo),
      })
        .then((res) => {
          alert('successfully.');
          navigate('/');
        })
        .catch((err) => {
          alert('Failed: ' + err.message);
        });
    }
  };

  return (
    <div className='contactForm' id='contact'>
      <form onSubmit={sendEmail}>
        <h1 className='titleContact'>Se Connecter Avec Nous</h1>
        <div className='input_Contact'>
          <i className='fas fa-user icons'></i>
          <input
            placeholder='Nom & Prenom'
            value={nom}
            onChange={(e) => setNom(e.target.value)}
            type='text'
            name='user_name'
            required
          />
        </div>
        <div className='input_Contact'>
          <i className='fas fa-envelope icons'></i>
          <input
            placeholder='Email'
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            type='email' // Changed input type to 'email'
            name='user_email'
            required
          />
        </div>
        <div className='input_Contact'>
          <i className='fas fa-phone icons'></i> {/* Changed to phone icon */}
          <input
            placeholder='Telephone'
            value={tele}
            onChange={(e) => setTele(e.target.value)}
            type='text' // Changed input type to 'text'
            name='user_telephone'
            required
          />
        </div>
        <div className='input_Contact'>
          <i className='fas fa-comments icons'></i>
          <textarea
            placeholder='Votre Message'
            value={theme}
            onChange={(e) => setTheme(e.target.value)}
            id='message'
            name='message'
            rows={4}
            required
          />
        </div>
        {/* ************************************************** */}
        <div className='experienceTop'>
          <div className='containerEX'>
            <div className={isEditing ? 'star-widget' : 'star-widget hidden'}>
              <input
                onClick={() => setStar('5')}
                type='radio'
                name='rate'
                id='rate-5'
                checked={star === '5'}
              />
              <label htmlFor='rate-5' className='fas fa-star'></label>
              {/* Other star rating inputs */}
            </div>
          </div>
        </div>
        {/* ******************************************************************** */}
        <button className='buttonSubmit' type='submit'>
          <i className='fas fa-paper-plane icons-button '></i>Submit
        </button>
      </form>
    </div>
  );
}

export default Contact;
